import styled from 'styled-components'

const Div = styled.div`
    display: flex;
    align-items: center;
    height: 2em;
    width: fit-content;
    border-style: solid;

    p {
        margin-left: auto;
        margin-right: 0.5em;
        width: 8em;
        text-align: right;
    }
`;

const User = () => {

    const username = localStorage.getItem('username');

    return (
        <Div>
            <a>Logout</a>
            <p>{username}</p>
        </Div>
    )
}

export default User
